import React, { Component } from "react";
import Nav from "../components/Nav";
import Title from "../components/Title";
import Header from "../components/Header";
import "../map.css";

class Plant extends Component {
    render () {
        return (
            <div>
                <Nav />
                <Title />
                <Header />
            </div>
        );
    }
}

export default Plant;
